    public static int lengthOfLongestSubstring(String s) {
    	int res=1;
    	
    	if(s.length() == 1){
    		return 1;
    	}
    	if(s.length() == 0){
    		return 0;
    	}
    	
    	for(int i=0;i<s.length();i++){
    		Map<Character,Character> map = new HashMap<Character, Character>();
    		map.put(s.charAt(i), s.charAt(i));
    		
    		int j=i+1;
    		char cc='\0';
    		if(j<s.length()){
    			cc = s.charAt(j);
    		}
    		while(j<s.length() && !map.containsKey(cc)){
    			map.put(cc, cc);
    			j++;
    			if(j<s.length()){
        			cc = s.charAt(j);
        		}
    		}
    		if( map.size() > res){
    			res = map.size();
    		}
    	}
        return res;
    }
